        [2949] = {7060120,"เทพ·พิโรธมังกรเขียว","ปล่อยสกิลทำให้ขุนพลฝ่ายเราทั้งหมดฟื้นฟูโทสะ1แต้มและดาเมจฝ่ายเราทั้งหมดเพิ่ม12%ดาเมจคริขุนพลฝ่ายเราทั้งหมดเพิ่ม8%ต่อเนื่อง1กระบวนท่าพ่วงสัญลักษณ์มังกรเขียว1อันให้เป้าหมายที่มีโทสะน้อยสุด2คนต่อเนื่อง1กระบวนท่าสัญลักษณ์มังกรเขียวจะฟื้นฟูโทสะ1แต้มให้กับเป้าหมายก่อนขุนพลลงมือ",},
